  "id_str" : "152596589570043905",
  "text" : "セキュリティーソフトウェアに対する「信用」は、もちろん処理の軽さとか検出率とかあるけど、それ以前に「そのソフトウェア自体が悪さをしない」っていうこと。それを破ってしまったマカフィーはダメすぎる。 [n]",
