  "text" : "何を持って「成分」とするかによるけど抗原違うだけですからねぇ。 QT @akira1128: 血液型診断って馬鹿にする人多いけど、ほんとに全く何の影響も与えてないって言い切れるんだろうか？　要は血液の成分が違うわけでしょう？",
